import React from 'react';
import { useState,useEffect } from 'react';
import AdminNavbbar from './AdminNavbar';
import Axios from "axios";
import Box from "@mui/material/Box";
import { container, listItem, typography } from "./style";
import { Button, Container, List, ListItem, Typography } from "@mui/material";

function AdminNotificatin() {

    const [clearancelist,setClearancelist] = useState([]);
    const [reg,setReg] = useState("");
    const [status,setStatus] = useState("Approved");

    useEffect(() => {
        Axios.get("http://localhost:3001/fetchClearance").then((response) => {
          setClearancelist(response.data);
          //console.log(userList.length);
          
          
          //console.log(response.data);
        });
      },[]);

      const approving = (reg) => {
        Axios.post("http://localhost:3001/approvedclearanceData" , {reg:reg,status:status}).then((response) => {
      console.log(response);
      //navigate.push("/")
    });
      }

      

  return (
    <>
      <AdminNavbbar/> 
    
    <br/>
    <br/>
    
    

<Container maxWidth="lg" sx={container}>
        <Typography variant="h4" align="center" sx={typography}>
          Clearance Requests
        </Typography>
        
        <List>
          {clearancelist.map((val) => {
            return (
              <ListItem sx={listItem}>
                <Typography>
                  Name    : {val.firstName} {" "} {val.lastName}
                  <br />
                  Reg. No : {val.reg} <br />
                  Dept    : {val.dept} <br />
                  Session : {val.session} {"                                                             "} 


                 
                  <Button
          variant="contained"
          size="small"
          onClick={() => {
            approving(val.reg);
          }}
          
          
        >
          Approved
        </Button>
                </Typography>
              </ListItem>
            );
          })}
        </List>
      </Container>
    </>
  )
}

export default AdminNotificatin
